import React from "react";

const SearchBar = ({ keyword, setKeyword }) => {
  const BarStyling = {
    width: "20rem",
    background: "#F2F1F9",
    border: "none",
    padding: "0.5rem",
    height: "52px",
    borderRadius: "4px",
  };
  return (
    <input
      style={BarStyling}
      key="random1"
      value={keyword}
      placeholder={"Cerca..."}
      onChange={(e) => setKeyword(e.target.value)}
    />
  );
};

export default SearchBar;
